import React, { useEffect } from "react";
import axios from "axios";

const Chatpage = () => {
  const fetchChats = async () => {
    const {data} = await axios.get("/api/chats");
    console.log(data);
  };

  useEffect(() => {
    fetchChats();
  }, []);

  return <div>I am coming from Chatpage</div>;
};

export default Chatpage;
